4	Kubernetes/Helm/github	8c7bf79749636c46f87c27613150c49c8b85cba7	Hosting a Helm Repo from Github	This documentation shows my attempt at hosting a Helm repo at my Github account	f	t	\N			# Hosting a Helm Repo from GitHub\nThis page documents my first attempt at hosting a Helm repository using GitHub pages on my GitHub account at https://github.com/dlwhitehurst/helm-charts.\n\nI first had to set up the gh-pages branch. I haven't found instruction for a CNAME record, but I believe that this solution can use DNS and suffice as a public Helm repository. The GitHub pages branch hosts over the public internet just like a web server and GitHub actions can be used to prepare the Helm release.\n\n	<h1 class="toc-header" id="hosting-a-helm-repo-from-github"><a href="#hosting-a-helm-repo-from-github" class="toc-anchor">¶</a> Hosting a Helm Repo from GitHub</h1>\n<p>This page documents my first attempt at hosting a Helm repository using GitHub pages on my GitHub account at <a class="is-external-link" href="https://github.com/dlwhitehurst/helm-charts">https://github.com/dlwhitehurst/helm-charts</a>.</p>\n<p>I first had to set up the gh-pages branch. I haven't found instruction for a CNAME record, but I believe that this solution can use DNS and suffice as a public Helm repository. The GitHub pages branch hosts over the public internet just like a web server and GitHub actions can be used to prepare the Helm release.</p>\n	[{"title":"Hosting a Helm Repo from GitHub","anchor":"#hosting-a-helm-repo-from-github","children":[]}]	markdown	2023-01-09T15:03:21.882Z	2023-01-09T15:03:26.576Z	markdown	en	1	1	{"js":"","css":""}
2	Journal/jan2023	1e8011f5b1776e65a972ee377ae56f66edbf2556	January 2023	Journal page for January 2023	f	t	\N			# January 2023\nThis is the journal page for January 2023.\n\nPhoto by <a href="https://unsplash.com/es/@freestocks?utm_source=unsplash&utm_medium=referral&utm_content=creditCopyText">freestocks</a> on <a href="https://unsplash.com/photos/Gnxquq4oYQc?utm_source=unsplash&utm_medium=referral&utm_content=creditCopyText">Unsplash</a>\n\n![freestocks-gnxquq4oyqc-unsplash.jpg](/freestocks-gnxquq4oyqc-unsplash.jpg)\n## Week of Jan 1 - Jan 7\n### Sun 1\n### Mon 2\n- Holiday 8hr\n\n### Tue 3\n263 mg/Dl fast\n- John Hancock email no-log\n- Self Eval 2022 2hr\n- Azure self-training for Securitas (non-billable yet) 6hr\n\n### Wed 4\n348 mg/Dl fast (cookies)\n- Azure self-training for Securitas, reading book "Microsoft Azure Fundamentals Certification and Beyond" 4hr\n- Installing Rook-Ceph CSI choice for Kubernetes (complete and tested) 4hr\n\n### Thu 5\n- Comparing Rook-Ceph CSI storage to NFS 1hr\n- Installing NFS CSI storage with auto-provisioning on Kubernetes (working still) 1hr\n- Bench time spent creating a Kubernetes cluster on Azure as waiting on working for Securitas (Sujay arranging) 6hr\n\n### Fri 6\n- Completed self-eval of personnel review. 2hr\n- Focus on Azure high-level training to support whatever Securitas needs per Sujay (probably relational database standup today) - told might start Monday 6hr\n\n### Sat 7\n\n## Week of Jan 8 - Jan 14\n### Sun 8\n- Boxing bedroom for restore of flooring\n### Mon 9\n- Working on Helm repo and Github actions, host from Github pages\n- Successfully set up a Helm repo using GitHub pages to host my custom Helm chart\n### Tue 10\n- Layout documentation for access to AWS, Google, and Azure in this wiki.\n- Return to Azure study high-level\n- Ask Ryan if he knows anything, Sujay?\n### Wed 11\n### Thu 12\n### Fri 13\n### Sat 14\n\n## Week of Jan 15 - Jan 21\n### Sun 15\n### Mon 16\n### Tue 17\n### Wed 18\n### Thu 19\n### Fri 20\n### Sat 21\n\n## Week of Jan 22 - Jan 28\n### Sun 22\n### Mon 23\n### Tue 24\n### Wed 25\n### Thu 26\n### Fri 27\n### Sat 28\n\n## Week of Jan 29 - Jan 31\n### Sun 29\n### Mon 30\n### Tue 31	<h1 class="toc-header" id="january-2023"><a href="#january-2023" class="toc-anchor">¶</a> January 2023</h1>\n<p>This is the journal page for January 2023.</p>\n<p>Photo by <a class="is-external-link" href="https://unsplash.com/es/@freestocks?utm_source=unsplash&amp;utm_medium=referral&amp;utm_content=creditCopyText">freestocks</a> on <a class="is-external-link" href="https://unsplash.com/photos/Gnxquq4oYQc?utm_source=unsplash&amp;utm_medium=referral&amp;utm_content=creditCopyText">Unsplash</a></p>\n<p><img alt="freestocks-gnxquq4oyqc-unsplash.jpg" src="/freestocks-gnxquq4oyqc-unsplash.jpg"></p>\n<h2 class="toc-header" id="week-of-jan-1-jan-7"><a href="#week-of-jan-1-jan-7" class="toc-anchor">¶</a> Week of Jan 1 - Jan 7</h2>\n<h3 class="toc-header" id="sun-1"><a href="#sun-1" class="toc-anchor">¶</a> Sun 1</h3>\n<h3 class="toc-header" id="mon-2"><a href="#mon-2" class="toc-anchor">¶</a> Mon 2</h3>\n<ul>\n<li>Holiday 8hr</li>\n</ul>\n<h3 class="toc-header" id="tue-3"><a href="#tue-3" class="toc-anchor">¶</a> Tue 3</h3>\n<p>263 mg/Dl fast</p>\n<ul>\n<li>John Hancock email no-log</li>\n<li>Self Eval 2022 2hr</li>\n<li>Azure self-training for Securitas (non-billable yet) 6hr</li>\n</ul>\n<h3 class="toc-header" id="wed-4"><a href="#wed-4" class="toc-anchor">¶</a> Wed 4</h3>\n<p>348 mg/Dl fast (cookies)</p>\n<ul>\n<li>Azure self-training for Securitas, reading book "Microsoft Azure Fundamentals Certification and Beyond" 4hr</li>\n<li>Installing Rook-Ceph CSI choice for Kubernetes (complete and tested) 4hr</li>\n</ul>\n<h3 class="toc-header" id="thu-5"><a href="#thu-5" class="toc-anchor">¶</a> Thu 5</h3>\n<ul>\n<li>Comparing Rook-Ceph CSI storage to NFS 1hr</li>\n<li>Installing NFS CSI storage with auto-provisioning on Kubernetes (working still) 1hr</li>\n<li>Bench time spent creating a Kubernetes cluster on Azure as waiting on working for Securitas (Sujay arranging) 6hr</li>\n</ul>\n<h3 class="toc-header" id="fri-6"><a href="#fri-6" class="toc-anchor">¶</a> Fri 6</h3>\n<ul>\n<li>Completed self-eval of personnel review. 2hr</li>\n<li>Focus on Azure high-level training to support whatever Securitas needs per Sujay (probably relational database standup today) - told might start Monday 6hr</li>\n</ul>\n<h3 class="toc-header" id="sat-7"><a href="#sat-7" class="toc-anchor">¶</a> Sat 7</h3>\n<h2 class="toc-header" id="week-of-jan-8-jan-14"><a href="#week-of-jan-8-jan-14" class="toc-anchor">¶</a> Week of Jan 8 - Jan 14</h2>\n<h3 class="toc-header" id="sun-8"><a href="#sun-8" class="toc-anchor">¶</a> Sun 8</h3>\n<ul>\n<li>Boxing bedroom for restore of flooring</li>\n</ul>\n<h3 class="toc-header" id="mon-9"><a href="#mon-9" class="toc-anchor">¶</a> Mon 9</h3>\n<ul>\n<li>Working on Helm repo and Github actions, host from Github pages</li>\n<li>Successfully set up a Helm repo using GitHub pages to host my custom Helm chart</li>\n</ul>\n<h3 class="toc-header" id="tue-10"><a href="#tue-10" class="toc-anchor">¶</a> Tue 10</h3>\n<ul>\n<li>Layout documentation for access to AWS, Google, and Azure in this wiki.</li>\n<li>Return to Azure study high-level</li>\n<li>Ask Ryan if he knows anything, Sujay?</li>\n</ul>\n<h3 class="toc-header" id="wed-11"><a href="#wed-11" class="toc-anchor">¶</a> Wed 11</h3>\n<h3 class="toc-header" id="thu-12"><a href="#thu-12" class="toc-anchor">¶</a> Thu 12</h3>\n<h3 class="toc-header" id="fri-13"><a href="#fri-13" class="toc-anchor">¶</a> Fri 13</h3>\n<h3 class="toc-header" id="sat-14"><a href="#sat-14" class="toc-anchor">¶</a> Sat 14</h3>\n<h2 class="toc-header" id="week-of-jan-15-jan-21"><a href="#week-of-jan-15-jan-21" class="toc-anchor">¶</a> Week of Jan 15 - Jan 21</h2>\n<h3 class="toc-header" id="sun-15"><a href="#sun-15" class="toc-anchor">¶</a> Sun 15</h3>\n<h3 class="toc-header" id="mon-16"><a href="#mon-16" class="toc-