3	Beast/home	7caef1b26a0a93050deba9d7cd36ee4c46907091	Beast Home	This is the home page for the Beast server and Beast Kubernetes Cluster	f	t	\N			# Beast Home\nThis the home page for the Beast server and Beast Kubernetes cluster.\n\nPhoto by <a href="https://unsplash.com/@sigmund?utm_source=unsplash&utm_medium=referral&utm_content=creditCopyText">Sigmund</a> on <a href="https://unsplash.com/photos/IKXHeZw2XoY?utm_source=unsplash&utm_medium=referral&utm_content=creditCopyText">Unsplash</a>\n  \n![sigmund-ikxhezw2xoy-unsplash.jpg](/sigmund-ikxhezw2xoy-unsplash.jpg)\n\nBeast began with the gift of a Dell PowerEdge R720 server that my wife gave me as a birthday present almost 3 years ago. The server is refurbished but contains 4-2.x GHZ (8core) chips, or a total of 32cores or virtual CPUs. It arrived with 193GB of RAM and 18TB (total) of storage or 6 hot-swappable Seagate disks. The server also has two hot-swappable power supplies and will run with one in the event a power supply fails.\n\nJust after receiving the server, I purchased a commercial-grade UPS from Amazon Commercial to filter the power for the server (2 power supplies) and an LG monitor.\n\n## Use\nSince Beast has lots of resources, it's currently used to host Ubuntu 22.04 and act as a hypervisor with Oracle's VirtualBox. Beast is also used to describe a 5-node Kubernetes Cluster that's currently hosted to provide public online hosting of several applications, systems, or websites.\n\n## Kubernetes Documentation\nDocumentation for the Beast Kubernetes cluster can be found on Github in a public repository at https://github.com/dlwhitehurst/beast	<h1 class="toc-header" id="beast-home"><a href="#beast-home" class="toc-anchor">¶</a> Beast Home</h1>\n<p>This the home page for the Beast server and Beast Kubernetes cluster.</p>\n<p>Photo by <a class="is-external-link" href="https://unsplash.com/@sigmund?utm_source=unsplash&amp;utm_medium=referral&amp;utm_content=creditCopyText">Sigmund</a> on <a class="is-external-link" href="https://unsplash.com/photos/IKXHeZw2XoY?utm_source=unsplash&amp;utm_medium=referral&amp;utm_content=creditCopyText">Unsplash</a></p>\n<p><img alt="sigmund-ikxhezw2xoy-unsplash.jpg" src="/sigmund-ikxhezw2xoy-unsplash.jpg"></p>\n<p>Beast began with the gift of a Dell PowerEdge R720 server that my wife gave me as a birthday present almost 3 years ago. The server is refurbished but contains 4-2.x GHZ (8core) chips, or a total of 32cores or virtual CPUs. It arrived with 193GB of RAM and 18TB (total) of storage or 6 hot-swappable Seagate disks. The server also has two hot-swappable power supplies and will run with one in the event a power supply fails.</p>\n<p>Just after receiving the server, I purchased a commercial-grade UPS from Amazon Commercial to filter the power for the server (2 power supplies) and an LG monitor.</p>\n<h2 class="toc-header" id="use"><a href="#use" class="toc-anchor">¶</a> Use</h2>\n<p>Since Beast has lots of resources, it's currently used to host Ubuntu 22.04 and act as a hypervisor with Oracle's VirtualBox. Beast is also used to describe a 5-node Kubernetes Cluster that's currently hosted to provide public online hosting of several applications, systems, or websites.</p>\n<h2 class="toc-header" id="kubernetes-documentation"><a href="#kubernetes-documentation" class="toc-anchor">¶</a> Kubernetes Documentation</h2>\n<p>Documentation for the Beast Kubernetes cluster can be found on Github in a public repository at <a class="is-external-link" href="https://github.com/dlwhitehurst/beast">https://github.com/dlwhitehurst/beast</a></p>\n	[{"title":"Beast Home","anchor":"#beast-home","children":[{"title":"Use","anchor":"#use","children":[]},{"title":"Kubernetes Documentation","anchor":"#kubernetes-documentation","children":[]}]}]	markdown	2023-01-07T15:47:01.392Z	2023-01-07T16:15:13.344Z	markdown	en	1	1	{"js":"","css":""}
7	Cloud/Azure/cosmos	154bf43b8dc75495f74a100d80a6b21ece983901	Cosmos Database	Later	f	t	\N			# Cosmos Database\nA NoSQL and SQL database for Azure. Not sure about this but I'm going to create one and see how to use it on my free account.\n\n## Connect Private\nuser=citus\npassword=DevPrince0706\n\n```bash\npsql "host=c.postgres-ha-cluster.postgres.database.azure.com port=5432 dbname=citus user=citus password=DevPrince0706 sslmode=require"\n```\n> This connect string did not work from my newly created VM. This is probably because the firewall rules currently allow only port 22 (SSL). I need to see if the console provides firewall configuration and modification otherwise I need to do this via ufw (I think).\n{.is-warning}\n\n## Resource Template\nThis is a JSON representation of the Cosmos Private Postgresql resource.\n```json\n{\n    "$schema": "http://schema.management.azure.com/schemas/2015-01-01/deploymentTemplate.json#",\n    "contentVersion": "1.0.0.0",\n    "parameters": {\n        "serverGroupName": {\n            "type": "String"\n        },\n        "location": {\n            "type": "String"\n        },\n        "administratorLoginPassword": {\n            "type": "SecureString"\n        },\n        "previewFeatures": {\n            "type": "Bool"\n        },\n        "postgresqlVersion": {\n            "type": "String"\n        },\n        "coordinatorVcores": {\n            "type": "Int"\n        },\n        "coordinatorStorageSizeMB": {\n            "type": "Int"\n        },\n        "numWorkers": {\n            "type": "Int"\n        },\n        "workerVcores": {\n            "type": "Int"\n        },\n        "workerStorageSizeMB": {\n            "type": "Int"\n        },\n        "enableHa": {\n            "type": "Bool"\n        },\n        "enablePublicIpAccess": {\n            "type": "Bool"\n        },\n        "serverGroupTags": {\n            "type": "Object"\n        },\n        "privateEndpointName": {\n            "type": "String"\n        },