8	Interests/chatgpt	54ac9627b0743dacc9244edb769a31baedf032ba	ChatGPT	Later	f	t	\N			# ChatGPT\nIt's very interesting what ChatGPT can do. \n\nFrom https://beta.openai.com/playground\n\n#### My Entry\nA way to respond to the practice of abortion\n\n#### Output\nThe practice of abortion is a deeply personal and complex issue, and it is important to be respectful and understanding of the different perspectives on it. With that being said, I believe that every person's right to make decisions about their own body should be respected and protected. As such, I would support providing accessible and affordable healthcare options to ensure that women have the resources and information they need to make informed decisions about their reproductive health.\n\n	<h1 class="toc-header" id="chatgpt"><a href="#chatgpt" class="toc-anchor">¶</a> ChatGPT</h1>\n<p>It's very interesting what ChatGPT can do.</p>\n<p>From <a class="is-external-link" href="https://beta.openai.com/playground">https://beta.openai.com/playground</a></p>\n<h4 class="toc-header" id="my-entry"><a href="#my-entry" class="toc-anchor">¶</a> My Entry</h4>\n<p>A way to respond to the practice of abortion</p>\n<h4 class="toc-header" id="output"><a href="#output" class="toc-anchor">¶</a> Output</h4>\n<p>The practice of abortion is a deeply personal and complex issue, and it is important to be respectful and understanding of the different perspectives on it. With that being said, I believe that every person's right to make decisions about their own body should be respected and protected. As such, I would support providing accessible and affordable healthcare options to ensure that women have the resources and information they need to make informed decisions about their reproductive health.</p>\n	[{"title":"ChatGPT","anchor":"#chatgpt","children":[]}]	markdown	2023-01-15T14:48:43.228Z	2023-01-15T14:48:47.075Z	markdown	en	1	1	{"js":"","css":""}
5	Cloud/Azure/subscription	5d3d05ec51db3e1d38044a9b2ebbd8c6844e7441	Azure Subscription	This is a page related to my Azure subscription using Argano email	f	t	\N			# Azure Subscription\nThis is a page to document my current Azure (personal) subscription.\n\nThe account was a free-credit starter subscription using my work email. They (Microsoft) would not allow me to create a non-enterprise account using my personal email.\n\nUser david.whitehurst@argano.com\n\nI have created an AKS kubernetes cluster using a terminal (Ubuntu) on my machine INTEL-NUC. Microsoft and this account has record of this machine by a device object ID 6db87c8d-ff46-4398-a9f1-e884b1d8a545\n\n## Access\nIt is important to note that there are different ways to access Azure. The online method begins with https://portal.azure.com. I like the command line access using the CLI tool. \n\n### Azure-CLI\nDocumentation resides here for the Azure command line interface (CLI). Example commands would be found here for reference.\n\nPer Microsoft as of Dec 27, 2022.\n> The current version of the Azure CLI is 2.43.0.\n{.is-info}\n\n#### Install\nOne command @ WSL\n```bash\ncurl -sL https://aka.ms/InstallAzureCLIDeb | sudo bash\n```\n#### Verify\n```bash\naz --version\n```\n\n#### Reference\nhttps://learn.microsoft.com/en-us/cli/azure/\n\n## Observations\nMy first observations are that this platform is tightly controlled, not well documented, and over-priced. It would NOT be my choice of platform if I were the decision maker. \n\n## Journal\n### Jan 5, 2023\n- Created an AKS (Azure Kubernetes Service) cluster today `aks-cluster-1` in my subscription. It's very small because my free allowance would only give me one node besides master. I do not know if I have storage (CSI). I'm assuming I have networking (CNI). We'll see in a minute as I try to run an Apache pod using `kubectl` if I can find it.\n\n#### Config\n- Version 1.24.6 (default)\n- Auto-update built-in\n\n#### Networking\n- API Server Address aks-cluster-1-dns-4645e536.hcp.eastus.azmk8s.io\n- Network Type (plugin) - Kubenet\n- POD CIDR 10.244.0.0/16\n- Service CIDR 10.0.0.0/16\n- DNS Service IP 10.0.0.10\n- Docker Bridge CIDR 172.17.0.1/16\n- LoadBalancer Standard (????)\n\n#### Connect\n- Cloud shell\n```bash\naz account set --subscription 5831c1af-e00c-4c92-83d2-76f314213963\naz aks get-credentials --resource-group ubuntu-prime --name aks-cluster-1\n```\nOnce connected `kubectl` is available.\n\n![cloud-shell.png](/cloud-shell.png)\n\n#### Deploy Something\n```bash\nkubectl run apache2 --image=httpd:2.4\nkubectl expose pod apache2 --port=80 --type=LoadBalancer\n```\nI had to wait a bit but eventually the default loadbalancer gave me an external IP. I navigated to this `http://20.85.193.234/` in a browser and `It Works!` was shown as the HTTP body. \n	<h1 class="toc-header" id="azure-subscription"><a href="#azure-subscription" class="toc-anchor">¶</a> Azure Subscription</h1>\n<p>This is a page to document my current Azure (personal) subscription.</p>\n<p>The account was a free-credit starter subscription using my work email. They (Microsoft) would not allow me to create a non-enterprise account using my personal email.</p>\n<p>User <a href="mailto:david.whitehurst@argano.com">david.whitehurst@argano.com</a></p>\n<p>I have created an AKS kubernetes cluster using a terminal (Ubuntu) on my machine INTEL-NUC. Microsoft and this account has record of this machine by a device object ID 6db87c8d-ff46-4398-a9f1-e884b1d8a545</p>\n<h2 class="toc-header" id="access"><a href="#access" class="toc-anchor">¶</a> Access</h2>\n<p>It is important to note that there are different ways to access Azure. The online method begins with <a class="is-external-link" href="https://portal.azure.com">https://portal.azure.com</a>. I like the command line access using the CLI tool.</p>\n<h3 class="toc-header" id="azure-cli"><a href="#azure-cli" class="toc-anchor">¶</a> Azure-CLI</h3>\n<p>Documentation resides here for the Azure command line interface (CLI). Example commands would be found here for reference.</p>\n<p>Per Microsoft as of Dec 27, 2022.</p>\n<blockquote class="is-info">\n<p>The current version of the Azure CLI is 2.43.0.</p>\n</blockquote>\n<h4 class="toc-header" id="install"><a href="#install" class="toc-anchor">¶</a> Install</h4>\n<p>One command @ WSL</p>\n<pre v-pre="true" class="prismjs line-numbers"><code class="language-bash">curl -sL https://aka.ms/InstallAzureCLIDeb | sudo bash\n</code></pre>\n<h4 class="toc-header" id="verify"><a href="#verify" class="toc-anchor">¶</a> Verify</h4>\n<pre v-pre="true" class="prismjs line-numbers"><code class="language-bash">az --version\n</code></pre>\n<h4 class="toc-header" id="reference"><a href="#reference" class="toc-anchor">¶</a> Reference</h4>\n<p><a class="is-external-link" href="https://learn.microsoft.com/en-us/cli/azure/">https://learn.microsoft.com/en-us/cli/azure/</a></p>\n<h2 class="toc-header" id="observations"><a href="#observations" class="toc-anchor">¶</a> Observations</h2>\n<p>My first observations are that this platform is tightly controlled, not well documented, and over-priced. It would NOT be my choice of platform if I were the decision maker.</p>\n<h2 class="toc-header" id="journal"><a href="#journal" class="toc-anchor">¶</a> Journal</h2>\n<h3 class="toc-header" id="jan-5-2023"><a href="#jan-5-2023" class="toc-anchor">¶</a> Jan 5, 2023</h3>\n<ul>\n<li>Created an AKS (Azure Kubernetes Service) cluster today <code>aks-cluster-1</code> in my subscription. It's very small because my free allowance would only give me one node besides master. I do not know if I have storage (CSI). I'm assuming I have networking (CNI). We'll see in a minute as I try to run an Apache pod using <code>kubectl</code> if I can find it.</li>\n</ul>\n<h4 class="toc-header" id="config"><a href="#config" class="toc-anchor">¶</a> Config</h4>\n<ul>\n<li>Version 1.24.6 (default)</li>\n<li>Auto-update built-in</li>\n</ul>\n<h4 class="toc-header" id="networking"><a href="#networking" class="toc-anchor">¶</a> Networking</h4>\n<ul>\n<li>API Server Address <a class="is-external-link" href="http://aks-cluster-1-dns-4645e536.hcp.eastus.azmk8s.io">aks-cluster-1-dns-4645e536.hcp.eastus.azmk8s.io</a></li>\n<li>Network Type (plugin) - Kubenet</li>\n<li>POD CIDR 10.244.0.0/16</li>\n<li>Service CIDR 10.0.0.0/16</li>\n<li>DNS Service IP 10.0.0.10</li>\n<li>Docker Bridge CIDR 172.17.0.1/16</li>\n<li>LoadBalancer Standard (????)</li>\n</ul>\n<h4 class="toc-header" id="connect"><a href="#connect" class="toc-anchor">¶</a> Connect</h4>\n<ul>\n<li>Cloud shell</li>\n</ul>\n<pre v-pre="true" class="prismjs line-numbers"><code class="language-bash">az account set --subscription 5831c1af-e00c-4c92-83d2-76f314213963\naz aks get-credentials --resource-group ubuntu-prime --name aks-cluster-1\n</code></pre>\n<p>Once connected <code>kubectl</code> is available.</p>\n<p><img alt="cloud-shell.png" src="/cloud-shell.png"></p>\n<h4 class="toc-header" id="deploy-something"><a href="#deploy-something" class="toc-anchor">¶</a> Deploy Something</h4>\n<pre v-pre="true" class="prismjs line-numbers"><code class="language-bash">kubectl run apache2 --image=httpd:2.4\nkubectl expose pod apache2 --port=80 --type=LoadBalancer\n</code></pre>\n<p>I had to wait a bit but eventually the default loadbalancer gave me an external IP. I navigated to this <code>http://20.85.193.234/</code> in a browser and <code>It Works!</code> was shown as the HTTP body.</p>\n	[{"title":"Azure Subscription","anchor":"#azure-subscription","children":[{"title":"Access","anchor":"#access","children":[{"title":"Azure-CLI","anchor":"#azure-cli","children":[{"title":"Install","anchor":"#install","children":[]},{"title":"Verify","anchor":"#verify","children":[]},{"title":"Reference","anchor":"#reference","children":[]}]}]},{"title":"Observations","anchor":"#observations","children":[]},{"title":"Journal","anchor":"#journal","children":[{"title":"Jan 5, 2023","anchor":"#jan-5-2023","children":[{"title":"Config","anchor":"#config","children":[]},{"title":"Networking","anchor":"#networking","children":[]},{"title":"Connect","anchor":"#connect","children":[]},{"title":"Deploy Something","anchor":"#deploy-something","children":[]}]}]}]}]	markdown	2023-01-12T16:09:33.249Z	2023-01-12T16:54:30.938Z	markdown	en	1	1	{"js":"","css":""}
6	Cloud/Azure/vm	f3c765a92b9ae9ed74faca5e0de21c7e20e8e8ba	Azure Virtual Machines	Later	f	t	\N			# Azure Virtual Machines\nThe following documentation is here to assist with repeat creation of Azure virtual machines.\n\n## Ubuntu VM\nhttps://ubuntu.com/azure\n\nI've now created a Ubuntu VM on the Azure platform. I first created a free account or subscription on Azure using david.whitehurst@argano.com. This account provides me free services for 30 days and then a pay-as-you-go option.\n\nI initially tried to create a VM from a top-level page and was only finding Windows instances to choose in the creation dropdown. I later found another way to create the VM after I looked up Linux images on Azure. They support RedHat, CentOS, Ubuntu, and some other less-popular Linux variants.\n\nI chose a 22.04 LTS Azure option with 2 VCPU and 4 GiB RAM. Port 22 open only (I think) but with a public IP and residing in a subnet within an overall private network for the Resource Group I created.\n\n## Connect\nhttps://learn.microsoft.com/en-us/azure/virtual-machines/linux-vm-connect?tabs=Linux\n\n```bash\nssh -i ~/.ssh/tucker-2204_key.pem david@172.174.42.252\n```\n\n## Info\nIt's Ubuntu but you know it's an Azure-optimized image.\n```bash\ndavid@tucker-2204:~$ uname -a\nLinux tucker-2204 5.15.0-1029-azure #36-Ubuntu SMP Mon Dec 5 19:31:08 UTC 2022 x86_64 x86_64 x86_64 GNU/Linux\n```\n\n## My Resource\n```json\n{\n    "name": "tucker-2204",\n    "id": "/subscriptions/5831c1af-e00c-4c92-83d2-76f314213963/resourceGroups/ubuntu-prime/providers/Microsoft.Compute/virtualMachines/tucker-2204",\n    "type": "Microsoft.Compute/virtualMachines",\n    "location": "eastus",\n    "properties": {\n        "vmId": "f4cd251a-4029-4313-bfa9-9f8c0bbbecdd",\n        "hardwareProfile": {\n            "vmSize": "Standard_B2s"\n        },\n        "storageProfile": {\n            "imageReference": {\n                "publisher": "canonical",\n                "offer": "0001-com-ubuntu-server-jammy",\n                "sku": "22_04-lts-gen2",\n                "version": "latest",\n                "exactVersion": "22.04.202212140"\n            },\n            "osDisk": {\n                "osType": "Linux",\n                "name": "tucker-2204_OsDisk_1_a834f22402864e3986b36fc9d1239b21",\n                "createOption": "FromImage",\n                "caching": "ReadWrite",\n                "managedDisk": {\n                    "storageAccountType": "StandardSSD_LRS",\n                    "id": "/subscriptions/5831c1af-e00c-4c92-83d2-76f314213963/resourceGroups/ubuntu-prime/providers/Microsoft.Compute/disks/tucker-2204_OsDisk_1_a834f22402864e3986b36fc9d1239b21"\n                },\n                "deleteOption": "Delete",\n                "diskSizeGB": 30\n            },\n            "dataDisks": []\n        },\n        "osProfile": {\n            "computerName": "tucker-2204",\n            "adminUsername": "david",\n            "linuxConfiguration": {\n                "disablePasswordAuthentication": true,\n                "ssh": {\n                    "publicKeys": [\n                        {\n                            "path": "/home/david/.ssh/authorized_keys",\n                            "keyData": "ssh-rsa  generated-by-azure"\n                        }\n                    ]\n                },\n                "provisionVMAgent": true,\n                "patchSettings": {\n                    "patchMode": "ImageDefault",\n                    "assessmentMode": "ImageDefault"\n                }\n            },\n            "secrets": [],\n            "allowExtensionOperations": true,\n            "requireGuestProvisionSignal": true\n        },\n        "networkProfile": {\n            "networkInterfaces": [\n                {\n                    "id": "/subscriptions/5831c1af-e00c-4c92-83d2-76f314213963/resourceGroups/ubuntu-prime/providers/Microsoft.Network/networkInterfaces/tucker-2204591",\n                    "properties": {\n                        "deleteOption": "Detach"\n                    }\n                }\n            ]\n        },\n        "diagnosticsProfile": {\n            "bootDiagnostics": {\n                "enabled": true\n            }\n        },\n        "provisioningState": "Succeeded"\n    }\n}\n```\n## Next\nLook up the Azure CLI tool. This page is focused on, specifically, the Ubuntu VM. But I do think the Azure CLI tool may allow connection to the VM differently than just the ssh option here. https://learn.microsoft.com/en-us/cli/azure/	<h1 class="toc-header" id="azure-virtual-machines"><a href="#azure-virtual-machines" class="toc-anchor">¶</a> Azure Virtual Machines</h1>\n<p>The following documentation is here to assist with repeat creation of Azure virtual machines.</p>\n<h2 class="toc-header" id="ubuntu-vm"><a href="#ubuntu-vm" class="toc-anchor">¶</a> Ubuntu VM</h2>\n<p><a class="is-external-link" href="https://ubuntu.com/azure">https://ubuntu.com/azure</a></p>\n<p>I've now created a Ubuntu VM on the Azure platform. I first created a free account or subscription on Azure using <a href="mailto:david.whitehurst@argano.com">david.whitehurst@argano.com</a>. This account provides me free services for 30 days and then a pay-as-you-go option.</p>\n<p>I initially tried to create a VM from a top-level page and was only finding Windows instances to choose in the creation dropdown. I later found another way to create the VM after I looked up Linux images on Azure. They support RedHat, CentOS, Ubuntu, and some other less-popular Linux variants.</p>\n<p>I chose a 22.04 LTS Azure option with 2 VCPU and 4 GiB RAM. Port 22 open only (I think) but with a public IP and residing in a subnet within an overall private network for the Resource Group I created.</p>\n<h2 class="toc-header" id="connect"><a href="#connect" class="toc-anchor">¶</a> Connect</h2>\n<p><a class="is-external-link" href="https://learn.microsoft.com/en-us/azure/virtual-machines/linux-vm-connect?tabs=Linux">https://learn.microsoft.com/en-us/azure/virtual-machines/linux-vm-connect?tabs=Linux</a></p>\n<pre v-pre="true" class="prismjs line-numbers"><code class="language-bash">ssh -i ~/.ssh/tucker-2204_key.pem david@172.174.42.252\n</code></pre>\n<h2 class="toc-header" id="info"><a href="#info" class="toc-anchor">¶</a> Info</h2>\n<p>It's Ubuntu but you know it's an Azure-optimized image.</p>\n<pre v-pre="true" class="prismjs line-numbers"><code class="language-bash">david@tucker-2204:~$ uname -a\nLinux tucker-2204 5.15.0-1029-azure #36-Ubuntu SMP Mon Dec 5 19:31:08 UTC 2022 x86_64 x86_64 x86_64 GNU/Linux\n</code></pre>\n<h2 class="toc-header" id="my-resource"><a href="#my-resource" class="toc-anchor">¶</a> My Resource</h2>\n<pre v-pre="true" class="prismjs line-numbers"><code class="language-json">{\n    "name": "tucker-2204",\n    "id": "/subscriptions/5831c1af-e00c-4c92-83d2-76f314213963/resourceGroups/ubuntu-prime/providers/Microsoft.Compute/virtualMachines/tucker-2204",\n    "type": "Microsoft.Compute/virtualMachines",\n    "location": "eastus",\n    "properties": {\n        "vmId": "f4cd251a-4029-4313-bfa9-9f8c0bbbecdd",\n        "hardwareProfile": {\n            "vmSize": "Standard_B2s"\n        },\n        "storageProfile": {\n            "imageReference": {\n                "publisher": "canonical",\n                "offer": "0001-com-ubuntu-server-jammy",\n                "sku": "22_04-lts-gen2",\n                "version": "latest",\n                "exactVersion": "22.04.202212140"\n            },\n            "osDisk": {\n                "osType": "Linux",\n                "name": "tucker-2204_OsDisk_1_a834f22402864e3986b36fc9d1239b21",\n                "createOption": "FromImage",\n                "caching": "ReadWrite",\n                "managedDisk": {\n                    "storageAccountType": "StandardSSD_LRS",\n                    "id": "/subscriptions/5831c1af-e00c-4c92-83d2-76f314213963/resourceGroups/ubuntu-prime/providers/Microsoft.Compute/disks/tucker-2204_OsDisk_1_a834f22402864e3986b36fc9d1239b21"\n                },\n                "deleteOption": "Delete",\n                "diskSizeGB": 30\n            },\n            "dataDisks": []\n        },\n        "osProfile": {\n            "computerName": "tucker-2204",\n            "adminUsername": "david",\n            "linuxConfiguration": {\n                "disablePasswordAuthentication": true,\n                "ssh": {\n                    "publicKeys": [\n                        {\n                            "path": "/home/david/.ssh/authorized_keys",\n                            "keyData": "ssh-rsa  generated-by-azure"\n                        }\n                    ]\n                },\n                "provisionVMAgent": true,\n                "patchSettings": {\n                    "patchMode": "ImageDefault",\n                    "assessmentMode": "ImageDefault"\n                }\n            },\n            "secrets": [],\n            "allowExtensionOperations": true,\n            "requireGuestProvisionSignal": true\n        },\n        "networkProfile": {\n            "networkInterfaces": [\n                {\n                    "id": "/subscriptions/5831c1af-e00c-4c92-83d2-76f314213963/resourceGroups/ubuntu-prime/providers/Microsoft.Network/networkInterfaces/tucker-2204591",\n                    "properties": {\n                        "deleteOption": "Detach"\n                    }\n                }\n            ]\n        },\n        "diagnosticsProfile": {\n            "bootDiagnostics": {\n                "enabled": true\n            }\n        },\n        "provisioningState": "Succeeded"\n    }\n}\n</code></pre>\n<h2 class="toc-header" id="next"><a href="#next" class="toc-anchor">¶</a> Next</h2>\n<p>Look up the Azure CLI tool. This page is focused on, specifically, the Ubuntu VM. But I do think the Azure CLI tool may allow connection to the VM differently than just the ssh option here. <a class="is-external-link" href="https://learn.microsoft.com/en-us/cli/azure/">https://l